import './StyleSheets/Nav.css';
import { Link } from 'react-router-dom';
import * as FaIcons  from "react-icons/fa";


function Nav() {
    return ( 
        <>
            <div className="navbar">
                <Link to="/" className='menu-bars'>
                    <FaIcons.FaBars />
                </Link>
            </div>    
        </>
     );
}

export default Nav;
